import React from "react";
import { Box, Heading, useColorMode, Divider } from "@chakra-ui/core";

const Settings = () => {
  const { colorMode } = useColorMode();
  return (
    <Box
      bg={`mode.${colorMode}.card`}
      p={4}
      rounded="sm"
      gridArea="1 / 1 / 2 / 2"
      h="100%"
    >
      <Heading as="h2" color={`mode.${colorMode}.title`}>
        Project details
      </Heading>
      <Divider />
    </Box>
  );
};

export default Settings;
